import * as React from "react";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import logo from "../Pages/logo.png";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import { Link } from "react-router-dom";
import NavbarSignUp from "../components/navbar/navbarSignUp";
import { useState, useEffect } from "react";

function Copyright(props: any) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright © Usahakuy.ID"}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const theme = createTheme();

export default function SignUp() {
  const [signUp, setSignUp] = useState<any[]>([]);
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [isValid, setIsValid] = useState(false);
  const [password, setPassword] = useState("");

  // const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
  //   event.preventDefault();
  //   const data = new FormData(event.currentTarget);
  //   console.log({
  //     email: data.get("email"),
  //     password: data.get("password"),
  //   });
  // };

  // const handleRegister = () => {
  //   setSignUp((prevSignUp) => [
  //     ...prevSignUp,
  //     {
  //       firstName: "",
  //       lastName: "",
  //       email: "",
  //       password: "",
  //     },
  //   ]);
  // };

  const handleRegister = () => {
    const prevSignUp = [...signUp];
    const afterSignUp = {
      firstName: "",
      lastName: "",
      email: "",
      password: "",
    };
    const newSignUp = prevSignUp.concat(afterSignUp);

    if (
      firstName === "" ||
      lastName === "" ||
      email === "" ||
      password === ""
    ) {
      alert("Please fill all the fields");
      setIsValid(true);
    } else {
      const newSignUp = prevSignUp.concat(afterSignUp);
      setIsValid(false);
    }

    setSignUp(newSignUp);
  };

  localStorage.setItem("signUp", JSON.stringify(signUp));

  useEffect(() => {
    const localStorageSignUp = JSON.parse(localStorage.getItem("signUp") || "");
    setSignUp(localStorageSignUp);
  }, [setSignUp]);

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <NavbarSignUp />
        <CssBaseline />
        <Box
          sx={{
            marginTop: 10,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <img src={logo} alt="Logo" width={100} height={100} />
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" sx={{ mt: 3 }} onSubmit={handleRegister}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="firstName"
                  required
                  fullWidth
                  id="firstName"
                  label="First Name"
                  autoFocus
                  onChange={(e) => setFirstName(e.target.value)}
                  value={firstName}
                  error={isValid}
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  required
                  fullWidth
                  id="lastName"
                  label="Last Name"
                  name="lastName"
                  autoComplete="family-name"
                  onChange={(e) => setLastName(e.target.value)}
                  value={lastName}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoComplete="email"
                  onChange={(e) => setEmail(e.target.value)}
                  value={email}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                  onChange={(e) => setPassword(e.target.value)}
                  value={password}
                />
              </Grid>
              <Grid item xs={12}>
                <FormControlLabel
                  control={
                    <Checkbox value="allowExtraEmails" color="primary" />
                  }
                  label="Saya ingin menerima penawaran promosi dan update pelatihan melalui email"
                />
              </Grid>
            </Grid>
            <Link to="/after">
              <Link to="/after">
                <Typography
                  sx={{ mb: 3, mt: 3 }}
                  className="btn btn-custom"
                  align="center"
                  onClick={handleRegister}
                >
                  Sign Up
                </Typography>
              </Link>
            </Link>
            {/* {signUp.length > 0 && (
              <ul>
                {signUp.map((item: any) => (
                  <li key={item.email}>{item.firstName}</li>
                ))}
              </ul>
            )} */}
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link to="/signIn">
                  <Typography className="sign">
                    Sudah Memiliki Akun? Masuk
                  </Typography>
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 5 }} />
      </Container>
    </ThemeProvider>
  );
}
